window.bookSummaryJSON = "<p>Charlie Decker traveled to Seattle to acquire a much needed loan for his family’s orchard. After a dozen requests, Charlie is forced to head home empty-handed. But his plans are derailed after an unexpected attack on the city renders all electronics useless. No cars. No phones. Everything about the modern world has been destroyed. And that’s when the chaos begins.</p>"; 
